import React, {useState, useEffect} from 'react'
import {Link, useHistory } from 'react-router-dom';
import EmployeeSevice from '../Service/EmployeeSevice';

const AddEmployee = () => {

    const [Id, setId] = useState('')
    const [age, setAge] = useState('')
    const [name, setName] = useState('')
    const [salary, setSalary] = useState('')
    const [dept_id, setDepartment_Id] = useState('')
    const history = useHistory();
   // const {Id} = useParams();

    const saveOrUpdateEmployee = (e) => {
        e.preventDefault();

        const employee = {Id, age, name, salary, dept_id}

        if(Id){
            EmployeeSevice.updateEmployee(Id, employee).then((response) => {
                history.push('/employees')
            }).catch(error => {
                console.log(error)
            })

        }else{
            EmployeeSevice.createEmployee(employee).then((response) =>{

                console.log(response.data)
    
                history.push('/add');
    
            }).catch(error => {
                console.log(error)
            })
        }
        
    }

    useEffect(() => {

        EmployeeSevice.getEmployeeById(Id).then((response) =>{
            setId(response.data.Id)
            setAge(response.data.age)
            setName(response.data.name)
            setSalary(response.data.salary)
            setDepartment_Id(response.data.dept_id)
        }).catch(error => {
            console.log(error)
        })
    }, [])

    const title = () => {

        if(Id){
            return <h2 className = "text-center">Update Employee</h2>
        }else{
            return <h2 className = "text-center">Add Employee</h2>
        }
    }

    return (
        <div>
           <br /><br />
           <div className = "container">
                <div className = "row">
                    <div className = "card col-md-6 offset-md-3 offset-md-3">
                       {
                           title()
                       }
                       
                        <div className = "card-body">
                            <form>
                            <div className = "form-group mb-2">
                                    <label className = "form-label"> Id :</label>
                                    <input
                                        type = "number"
                                        placeholder = "Enter Id"
                                        name = "Id"
                                        className = "form-control"
                                        value = {Id}
                                        onChange = {(e) => setId(e.target.value)}
                                    >
                                    </input>
                                </div>


                                <div className = "form-group mb-2">
                                    <label className = "form-label"> Name :</label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter name"
                                        name = "name"
                                        className = "form-control"
                                        value = {name}
                                        onChange = {(e) => setName(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label"> Age:</label>
                                    <input
                                        type = "number"
                                        placeholder = "Age"
                                        name = "age"
                                        className = "form-control"
                                        value = {age}
                                        onChange = {(e) => setAge(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label"> Salary :</label>
                                    <input
                                        type = "number"
                                        placeholder = "Salary"
                                        name = "salary"
                                        className = "form-control"
                                        value = {salary}
                                        onChange = {(e) => setSalary(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label"> Department Id :</label>
                                    <input
                                        type = "number"
                                        placeholder = "Dept _Id"
                                        name = "dept_id"
                                        className = "form-control"
                                        value = {dept_id}
                                        onChange = {(e) => setDepartment_Id(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <button className = "btn btn-success" onClick = {(e) => saveOrUpdateEmployee(e)} >Submit </button>
                                <Link to="/employees" className="btn btn-danger"> Cancel </Link>
                            </form>

                        </div>
                    </div>
                </div>

           </div>

        </div>
    )
}

export default AddEmployee
